def _get_mastapy_type(namespace: str, name: str):
    key = '{}.{}'.format(namespace, name)

    try:
        mastapy_module, mastapy_class = __map[key]

        module = modules.get(mastapy_module, None)

        if not module:
            with _DummyBaseClassImport():
                module = import_module(mastapy_module)

        return getattr(module, mastapy_class)

    except KeyError:
        raise CastException('Failed to find suitable cast for {}.'.format(
            key)) from None
